function rep_menu(){
    $('.toggle-mobile-btn').on('click',function(event){
        event.preventDefault();
        $(this).parents('.main-nav').toggleClass('active');
    });
    $('.main-nav').on('click','.btn-toggle-mobile-menu',function(event){
        $(this).toggleClass('active');
        $(this).prev().stop(true,false).slideToggle('fast');
    });
    $('.main-nav').on('click','.menu-item > a[href="#"]',function(event){
        event.preventDefault();
        $(this).toggleClass('active');
        $(this).next().stop(true,false).slideToggle('fast');
    });
}

$(document).ready(function (){
    if($(".js_sinhvien-slider").length > 0){
        $(".js_sinhvien-slider").each(function (){
            $(this).owlCarousel({
                items: 3,
                nav: false,
                dots: true,
                loop: true,
                autoWidth:true,
                navText: ['<i class="fa fa-long-arrow-left"></i>','<i class="fa fa-long-arrow-right"></i>'],
                animateIn: "slideInLeft",
                animateOut: "slideOutLeft",
                responsive: {
                    0:{
                        items:2,
                        dots: true,
                    },
                    600:{
                        items:2,
                        dots: false,
                    },
                    1000:{
                        items:3,
                        loop:false
                    }
                }
            });
        });
    }
    if($(".js_chuyen-nganh-slider").length > 0){
        $(".js_chuyen-nganh-slider").each(function(){
            $(this).owlCarousel({
                items: 3,
                nav: false,
                dots: true,
                loop: true,
                autoWidth:true,
                navText: ['<i class="fa fa-long-arrow-left"></i>','<i class="fa fa-long-arrow-right"></i>'],
                responsive: {
                    0:{
                        items:1,
                        dots: true,
                    },
                    600:{
                        items:2,
                        dots: false,
                    },
                    1000:{
                        items:3,
                        loop:false
                    }
                }
            });
        });
    }
    rep_menu();
    $('.dang_ky_btn').on("click",function(){
        $.fancybox.close();
    });
});

